def ok(n):
    s = str(n)
    d = list(map(int, s))
    sums = [d[i]*d[i+1] for i in range(len(s)-1)]
    return sorted(s) == sorted("".join(str(t) for t in sums))
print([k for k in range(10**5) if ok(k)]) # _Michael S. Branicky_, Nov 27 2024

